(1, 2, 1, 10, 1, 10, 1, 10, 1, 'Der Informatik Unterricht ist echt cool! Der macht voll spaß und mein Lehrer kann gut beibringen! Die Hausaufgaben sind zwar manchmal in den Fächern lang und doof, aber alles top.', NULL, NULL),
(2, 3, 7, 2, 4, 1, 8, 9, 4, 'Eigentlich gefällt es mir auf diese Schule zu gehen. Auch wenn es einige Aspekte gibt die mir nicht sehr gefallen. Letzte Änderungen jetzt, wir haben bock essesn zu gehen - die Demo muss jetzt funzen! Jo, wir haben swag!', NULL, NULL),
(3, 4, 10, 1, 3, 4, 8, 5, 7, 'Voll die Mädchenschule, ey. Egal, allerletzte Demo, wir haben wirklich, wirklich hunger, in der Mensa ist eine lange Schlange und wir müssen in 32 Minuten präsentieren.', NULL, NULL);
